    "about_me": "ENG//\nRüsty Deal is a multi-influenced rock band based in nantes. This french-dutch combo is made up by 4 musicians. The Brachet brothers and Paul Guihard, founded the band, which was later filled in by Quentin Bréhu when he took the bass guitarist’s spot.The band originally named Airdück would finally change its name into Rüsty Deal which is a tribute to Rusty Day, lead singer of the band Cactus who was shot in a drug deal that turned out badly. Founder member and early years co-composer Paul Guihard who left the band in the meantime, would do a short time return after the band’s unsuccessful try has a power trio. He would finally be replaced by Maxime Roulin after his permanent departure in september 2011. In december 2011 Rüsty Deal records its eponymous debut EP at the Black Desert Studio where 6 songs are recorded. These first songs allow the band to promote its music localy. The EP is a perfect picture of the particular state in which the band was, involving of course Maxime’s arrival but also the recent change of their name. Finally the band had inscribed the bases of their music on CD, the result was some old school raw and efficient rock n’ roll.\n\nYES, SOFTMACHINE, KING CRIMSON, HAWKWIND, BLUE ÖYSTER CULT, LED ZEPPELIN, BLACK SABBATH... are the major influences of the band, they mix up with modern influences like OPETH, GOJIRA, GOROD, SIDONY BOX, THE MELVINS... But RÜSTY DEAL doesn’t stick only to those influencese and has no hesitation to seek inspiration in Jazz music for example, especially when it comes to improvisation or the composition dynamics. In fact Rüsty Deal doesn’t follow the codes of the genre, but take them and distort them before producing it. the core of their music their is made up by prog rock, blues, death metal and aerial or psychedelic atmospheres. An odd mix, but prolific and exiting in terms of composition.\n\nThe aviator duck on the EP’s cover is the Airdück, the band’s mascot . It represents the band’s story and it institutes the graphic style of the band: a touch of comics and old cartoons blended with 70’s imagery.\n\nThe band is planning the release of their second EP for 2014.\n\n\n\nFR//\nRÜSTY DEAL est un groupe de rock aux multiples influences formé à Nantes. Cette formation franco-néerlandaise est constituée de quatre musiciens. Les deux frères Brachet et Paul Guihard fondent le groupe et sont bientôt rejoint par Quentin Bréhu qui prend la place de bassiste. Le groupe évoluant d’abord sous le nom d’Airdück change finalement son nom et devient Rüsty Deal qui est un hommage au chanteur de cactus Rusty Day abattu dans un deal de drogue qui mal tourné. Paul Guihard, membre fondateur ainsi que co-composieturs au début du groupe a quitté le groupe entre temps, il fait un court retour après que le groupe est évolué sans succès sous la forme d’un power trio. Il sera finallement remplacé par Maxime Roulin après son départ définitf en septembre 2011. En décembre 2011, RÜSTY DEAL enregistre son premier EP éponyme au Black Desert Studio où six titres sont enregistrés. Ces premiers titres leurs permettent de promouvoir leur musique localement. Cet EP est une représentation parfaite de ce qu’est le groupe a ce moment particulier, il inclus l’arrivée de Maxime Roulin mais également le changement récent de leur nom. Finalement le groupes a couché les bases de sa musique sur CD, le résultat est un condensé de rock old-school, brut et efficace.\n\nYES, SOFTMACHINE, KING CRIMSON, HAWKWIND, BLUE ÖYSTER CULT, LED ZEPPELIN, BLACK SABBATH... sont les influences majeurs du groupes, elles se mêlent à des influences contemporaines telles OPETH, GOJIRA, GOROD, SIDONY BOX, THE MELVINS... Mais RÜSTY DEAL ne s'arrête pas a ces influences et n'hésite pas à aller chercher son inspiration dans le Jazz, par exemple, notamment pour ce qui est de l'improvisation ou de la dynamique de composition. Le groupe ne suit pas les codes musicaux du genre mais se les approprie, les distord et les restitue !\nLe cœur de leurs compositions est fait de rock progressif, de blues, de death-metal et d’atmosphères aériennes ou psychédéliques. Un mélange incongru, inhabituel mais fructueux et très excitant en terme de composition.\n\nLe canard aviateur sur la pochette de l’EP est le Airdück la mascotte du groupe. Il représente l'histoire de RÜSTY DEAL et instaure le style graphique du groupe : une touche de Comics et de vieux cartoon mélangé à une imagerie très 70's.\n\nLe groupe prévoit de publier son second EP pour 2014\n\nAlbums:\nRüsty Deal (EP) 2012",
